export function fecthUrl(functionality, params) {
  const serverDomain = "http://localhost:5000";
  let url = serverDomain;
  switch (functionality) {
    case "POST-LOGIN":
      url += "/auth/login";
      break;
    case "POST-SIGNUP":
      url += +"/auth/signup";
      break;
    default:
      break;
  }

  return url;
}

export function fetchData(url, method, body) {}
